description:
Expert Advice for Today's Photographer Digital SLR Photography addresses the needs of today's photographer in a lively, informative and stylish format. Dedicated to digital SLR photographers of all abilities, from beginner through enthusiast to professional it will inform and entertain you through a unique blend of technique articles, inspirational images, news and authoritative reviews. Covering topics such as landscapes, portraits and close up photography, this magazine provides a focused and comprehensive read guaranteed to help you get the most out of your photography.

Digital SLR Photography - January 2014
Book Language: English 
Pages: 164
File Type: Pdf
File Size: 59.45 MB
